import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { majorDetailService } from '../../services/majorDetailService';
import '../../styles/pages/major-detail.css';

const AcademicMajorPage = () => {
    const { code } = useParams();
    const navigate = useNavigate();
    const [majorDetail, setMajorDetail] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchMajorDetail = async () => {
            try {
                setLoading(true);
                setError(null);
                const data = await majorDetailService.getMajorDetailByCode(code);
                if (!data) {
                    throw new Error(`Không tìm thấy thông tin ngành học với mã: ${code}`);
                }
                setMajorDetail(data);
            } catch (err) {
                setError(err.message);
            } finally {
                setLoading(false);
            }
        };

        if (code) {
            fetchMajorDetail();
        }
    }, [code]);

    if (loading) {
        return (
            <div className="loading-container">
                <div className="loading">Đang tải thông tin ngành học...</div>
            </div>
        );
    }

    if (error) {
        return (
            <div className="error-container">
                <div className="error">
                    <h2>Có lỗi xảy ra</h2>
                    <p>{error}</p>
                    <button onClick={() => navigate('/search/majors')}>
                        Quay lại trang tìm kiếm
                    </button>
                </div>
            </div>
        );
    }

    if (!majorDetail) return <div className="error">Không tìm thấy thông tin ngành học</div>;

    return (
        <div className="academic-major-page">
            <section className="academic-major-header">
                <h1>{majorDetail.name}</h1>
                <div className="academic-major-meta">
                    <span>🔢 Mã ngành: {majorDetail.code}</span>
                    <span>📚 Khối thi: {majorDetail.examBlocks}</span>
                    <span>🎯 Điểm chuẩn: {majorDetail.benchmarkScore}</span>
                    <span>💰 Học phí: {majorDetail.tuitionFee}</span>
                    {majorDetail.ranking && <span>⭐ {majorDetail.ranking}</span>}
                </div>
            </section>

            <div className="academic-major-content">
                <aside className="academic-major-sidebar">
                    <div className="major-info-card">
                        <h3>Thông tin cơ bản</h3>
                        <ul>
                            <li>Thời gian đào tạo: {majorDetail.duration}</li>
                            <li>Văn bằng: {majorDetail.degree}</li>
                            <li>Cơ hội việc làm: {majorDetail.employmentRate}</li>
                            <li>Nhu cầu tuyển dụng: {majorDetail.demandLevel}</li>
                            <li>Mức lương khởi điểm: {majorDetail.startingSalary}</li>
                            <li>Cơ hội du học: {majorDetail.studyAbroadOpportunity}</li>
                        </ul>
                    </div>
                </aside>

                <main className="major-main">
                    <section className="major-description">
                        <h2 className="section-title">Giới thiệu ngành</h2>
                        <p>{majorDetail.description}</p>

                        <h3>Chương trình đào tạo</h3>
                        <ul>
                            {majorDetail.curriculum.map((item, index) => (
                                <li key={index}>{item}</li>
                            ))}
                        </ul>
                    </section>

                    <section className="career-prospects">
                        <h2 className="section-title">Cơ hội nghề nghiệp</h2>
                        <div className="prospects-grid">
                            {majorDetail.careerProspects.map((career, index) => (
                                <div key={index} className="prospect-card">
                                    <h3>{career.title}</h3>
                                    <p>{career.description}</p>
                                    <p>Lương: {career.salary}</p>
                                </div>
                            ))}
                        </div>
                    </section>

                    <section className="universities">
                        <h2 className="section-title">Các trường đào tạo</h2>
                        <div className="universities-grid">
                            {majorDetail.universities.map((uni, index) => (
                                <a key={index} href={`/school/${uni.code}`} className="university-card">
                                    <h3>{uni.name}</h3>
                                    <p>Điểm chuẩn {uni.year}: {uni.benchmarkScore}</p>
                                    <p>Chỉ tiêu: {uni.quota}</p>
                                </a>
                            ))}
                        </div>
                    </section>
                </main>
            </div>
        </div>
    );
};

export default AcademicMajorPage;
